import Welcome from './components/Welcome';
import Products from './components/Products';
function App() {
  return (
    <div>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route><h1>Home Page</h1></Route>
      <Route path="/products">
        <Products />
      </Route>
    </div>
  );
}

export default App;
